INSERT INTO `faqs` VALUES (1, 'faq', 'FAQs', '<h1>How it Works test2</h1>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2>01.&nbsp;How does it work?</h2>\r\n\r\n<p>There are many&nbsp;<strong>eBoxes</strong>&nbsp;on this website. When you open one, you will find a random prize, chosen among the available items according to their chances. If you like what you just found, get it shipped straight to your house, or get the value of the item back as account credit.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2>02.&nbsp;Are the prizes truly random?</h2>\r\n\r\n<p>Of course. We use a&nbsp;<a href=\"https://en.wikipedia.org/wiki/Cryptographically_secure_pseudorandom_number_generator\"><strong>Cryptographically secure pseudorandom number generator</strong></a>. This means that nobody, not even us, can predict what the next chosen item will be.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2>03.&nbsp;Can I get my money back?</h2>\r\n\r\n<p>Once you deposit a sum on your account, you cannot get it back. Don&#39;t worry, though! Just buy a box and then get the prize shipped at your house, or try your luck again with another box if you don&#39;t like what you got!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '2019-11-26 19:14:56', '2019-11-26 19:15:00');
